import React from 'react'
import {Form, Segment, Button, Grid, Message, GridColumn} from "semantic-ui-react";
import style from "./login.module.css";

const Login = () => {
    return (
        <Grid textAlign="center" verticalAlign="middle" className={style.container}>
         <Grid.Column style={{maxWidth:450}}>
            <h1>Chatify</h1>
         </Grid.Column>
        </Grid>
    )
}

export default Login;
